export type TNavEntry = {
  readonly id: string;
  readonly label: string;
  readonly path: string;
};

type TNavEntryProps = TNavEntry;

function NavEntry({ id, label, path }: TNavEntryProps) {
  return (
    <div className='nav-item'>
      <Link href={path}>
        <a>{label}</a>
      </Link>
    </div>
  );
}

const navEntries = [
  { id: 'class', label: 'Class', path: '/courses' },
  { id: 'year', label: 'Year', path: '/years' },
  { id: 'venue', label: 'Venue', path: '/venues' },
  // { id: 'genre', label: 'Genre', path: '/genres' },
];

function Nav() {
  return (
    <nav>
      {navEntries.map(entry => (
        <NavEntry
          key={entry.id}
          id={entry.id}
          label={entry.label}
          path={entry.path}
        />
      ))}
    </nav>
  );
}

export default function Home() {
  return (
    <>
      <div className='full-logo'>
        <Logo />
      </div>
      <Nav />
      <div className='home-page-main'>
        <div>
          <h2 className='about'>ABOUT</h2>
          <p className='about-description'>
            Broken Records is the Bush School Record Label. Since 2003, students
            in the Upper School Music Department have been creating and
            recording all original music. Over the years, these original
            compositions have been preformed at The Venue. This website aims to
            display as much of that music as possible.
          </p>
        </div>
        <section className='video'>
          <video
            controls={true}
            width='720'
            crossOrigin='anonymous'
            autoPlay={true}
            preload='auto'
            src='/BrokenRecordsIntroVideo.mp4'
          >
            Sorry, your browser doesn't support embedded videos.
          </video>
        </section>
      </div>
      <div className='creator'>
        <h4>Created by Ryan Cohen</h4>
      </div>
    </>
  );
}
